import React from 'react';

import HeaderButtons from './Components/HeaderButtons';
import circlePlaceholder from './Icons/circlePlaceholder.png';
import rectanglePlaceholder from './Icons/rectanglePlaceholder.png';

const FirstPage = () => (
  <div>
    {/* First Section: Three Items Distributed Across the Width */}
    <div className="flex justify-center items-center">
      <div className="header">
        {/* Left Button */}
        <HeaderButtons 
            image={circlePlaceholder}
            description="LinkedIn" 
            url={"https://www.linkedin.com/in/isa-cantarero-525306b5/"}
        />

        {/* Title */}
        <HeaderButtons 
            image={rectanglePlaceholder}
            url={"https://www.isacantarero.com"}
            imgClassName = "title-btn-header-img"
        />

        {/* Right Button */}
        <HeaderButtons 
            image={circlePlaceholder}
            description="Message Me!" 
            onClick={"https://www.anatefrati.com/"}
        />
      </div>
    </div>

    {/* Second Section: Centered Image */}
    <div className="first-page-girl-div">
      <img src = {circlePlaceholder} alt="Placeholder" className="first-page-girl-img" />
    </div>

    {/* Third Section: Div with Left and Right Sections */}
    <div className="first-page-content-div">
      <div className="flex w-full max-w-6xl space-x-8">
        {/* Left Section: Image and Text */}
        <div className="w-1/2 space-y-4">
          <img src="https://via.placeholder.com/200" alt="Placeholder" className="w-full" />
          <p>Some descriptive text goes here.</p>
        </div>

        {/* Right Section: Stacked Buttons */}
        <div className="w-1/2 flex flex-col space-y-4 justify-center items-center">
          <button className="bg-red-500 text-white px-4 py-2 rounded w-1/2">Button A</button>
          <button className="bg-yellow-500 text-white px-4 py-2 rounded w-1/2">Button B</button>
          <button className="bg-purple-500 text-white px-4 py-2 rounded w-1/2">Button C</button>
        </div>
      </div>
    </div>
  </div>
);

export default FirstPage;
